'Candy Lips' is the story of a young woman's search for sexual satisfaction, without guilt or fear. In her early years, Susan remembers her upsetting home life which she endured until she made her bid for freedom and went to college. Frustrated ...    Full Descriptionby her broken home, she desparately tries to realign her sensitivity, only to be disrupted time and again by the &quot;new morality&quot; of her recent college atmosphere. It is sometime later that Susan meets Gloria; an artist both in her painting and lifestyle who introduces her to a new and healthy view of sex. As the film ends, we see that Susan has matured with understanding, and is determined to make her life one of fulfillment and happiness. mmm...

